import { createStore } from 'vuex'

export default createStore({
  state: {
    repo1_name: 'repoooo1',
    repo2_name: 'repoooo2',
    developer_num: 123,
    open_issue_num: 52,
    closed_issue_num: 30,
    issue_avg: 6,
    release_num: 40,
    issue_min: 1,
    issue_Q1: 2,
    issue_medium: 3,
    issue_Q3: 4,
    issue_max: 5,
    issue_variance: 1.7,

  },
  getters: {
    getTime(state){
      return state.time
    },
    getRepo1Name(state){
      return state.repo1_name
    },
    getRepo2Name(state){
      return state.repo2_name
    },
    getDevelopers(state){
      return state.developer_num
    },
    getOpenIssues(state){
      return state.open_issue_num
    },
    getCloseIssues(state){
      return state.closed_issue_num
    },
    getIssueAvg(state){
      return state.issue_avg
    },
    getReleases(state){
      return state.release_num
    }

  },
  mutations: {
    setTime(state, time){
      state.time = time
    }
  },
  actions: {

  },
  modules: {
  }
})
